import { Stack } from "@mui/material";
import React from "react";
import book from "./src/img/book.jpeg";

const Home = () => {
    return(
    <div>
    <Stack sx={{ml: -10, mr: -10, backgroundImage: `url(${book})`}} paddingTop='75px' textAlign='center' color={"text.primary"} bgcolor={"background.default"}>
        <h1>Welcome</h1>
        <p>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
    </Stack>
    </div>
    );
}

export default Home;
